/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `proc_check_data`()
BEGIN
	declare count int;
	select count(1) into count from t_project_field_define where project_id not in(select id from t_project);
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_project_field_define project_id error',',',count));
 	end if;
 	
	select count(1) into count from t_project_iteration where project_id not in(select id from t_project);
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_project_iteration project_id error',',',count));
 	end if;

	select count(1) into count from t_project_priority_define where project_id not in(select id from t_project);
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_project_priority_define project_id error',',',count));
 	end if;
	
	select count(1) into count from t_project_field_define a inner join t_project b on a.project_id=b.id where a.company_id!=b.company_id;
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_project_field_define company_id error',',',count));
 	end if;
 	
	select count(1) into count from t_project_priority_define a inner join t_project b on a.project_id=b.id where a.company_id!=b.company_id;
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_project_priority_define company_id error',',',count));
 	end if;
 	
	select count(1) into count from t_project_status_define a inner join t_project b on a.project_id=b.id where a.company_id!=b.company_id;
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_project_status_define company_id error',',',count));
 	end if;
 	
	select count(1) into count from t_project_module a inner join t_project b on a.project_id=b.id where a.company_id!=b.company_id;
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_project_module company_id error',',',count));
 	end if;
 	
	select count(1) into count from t_file where path is null;
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_file path error',',',count));
 	end if;
 	
	select count(1) into count from t_file a inner join t_file b on a.parent_id=b.id where a.level!=b.level+1;
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_file level error',',',count));
 	end if;
 	
	select count(1) into count from t_file a where a.level!=1 and a.parent_id=0;
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_file parent_id error',',',count));
 	end if;
 	
	select count(1) into count from t_task a where a.sub_task_count!=(select count(1) from t_task b where b.parent_id=a.id and b.is_delete=false);
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_task sub_task_count error',',',count));
 	end if;
 	
	select count(1) into count from t_task a where a.finish_sub_task_count!=(select count(1) from t_task b where b.`parent_id`=a.id and b.is_finish=true and b.is_delete=false);
 	if (count > 0) then
 		insert into t_call_proc_check_data_result(error_msg) values (concat('t_task finish_sub_task_count error',',',count));
 	end if;
END ;;
DELIMITER ;
