INSERT INTO `t_data_table` VALUES (1,1,'成员代码提交统计','默认','[1,11,18]',1,1,0,'var dataTable={\n    query:[\n		{name:\"部门名称\",type:\"text\"},\n    ],\n    execute(){\n        var d=new Date();\n        var year=d.getFullYear();\n        var month=d.getMonth()+1;\n        if(month>=10){\n            month=year+\'-\'+month;\n        }else{\n            month=year+\'-0\'+month;\n        }\n        //$.info(month)\n        //\n        var departmentName=$.param(\'部门名称\');\n        var accountList=null\n        if(!departmentName){\n            accountList=this.getAllAccountList();\n        }else{\n            accountList=this.getAccountListByDepartmentName(departmentName);\n        }\n        var inAccountIds=\'\';\n        if(accountList){\n            for (i = 0; i < accountList.size(); i++) {\n                inAccountIds=inAccountIds+accountList[i].id;\n                inAccountIds=inAccountIds+\',\';\n            }\n            inAccountIds=inAccountIds.substring(0,inAccountIds.length-1)\n        }\n        //\n		var sheet=$.createSheet();\n        var maxCol=33;\n		sheet.name=\'成员代码提交记录\'+month\n		for(var i=0;i<maxCol;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=60;\n        sheet.col[1].width=60;\n        for(var i=0;i<31;i++){\n            sheet.col[i+2].width=50;\n        }\n        \n		var header0=$.arrayToRow([\'成员代码提交统计\'+month]);\n		header0.cells[0].colspan=maxCol;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		sheet.header.add(header0);\n        //\n        var header=[\'姓名\',\'汇总\'];\n        for(var i=1;i<=31;i++){\n            header.push(i+\"号\")\n        }\n        //\n        var row=$.arrayToRow(header);\n        for(var i=0;i<maxCol;i++){\n            row.cells[i].bgcolor=\"8EE5EE\"\n        }\n        sheet.body.add(row);\n        //\n        if(accountList&&accountList.size()>0){\n            var logList=this.getScmCommitLogList(inAccountIds,month);\n            var map={};\n            for (i = 0; i < logList.size(); i++) {\n                var log=logList.get(i);\n                var accountId=log[\'account_id\']\n                if(!map[accountId]){\n                    map[accountId]={};\n                } \n                map[accountId][log[\'riqi\']]=log\n            }\n            //\n            for (i = 0; i < accountList.size(); i++) {\n                var account=accountList[i];\n                var accountId=account[\'id\']\n                var accountLogList=map[accountId];\n                if(!accountLogList){\n                    continue;\n                }\n                var cols=[account[\'name\']];\n                var monthTotal=0;\n                var dayDatas=[]\n                for(var d=1;d<=31;d++){\n                    var dayData=\'\'\n                    var day=\'\'\n                    if(d<10){\n                        day=month+\'-0\'+d;\n                    }else{\n                        day=month+\'-\'+d;\n                    }\n                    if(accountLogList&&accountLogList[day]){\n                        var accountLog=accountLogList[day];\n                        var totalNum=accountLog[\'total_num\'];\n                        if(totalNum!=0){\n                            monthTotal=monthTotal+totalNum\n                            dayData=totalNum+\'\'\n                        }\n                    }\n                    dayDatas.push(dayData)\n                }\n                cols.push(monthTotal+\'\')\n                cols=cols.concat(dayDatas)\n                row=$.arrayToRow(cols);\n                sheet.body.add(row);\n            }\n        }\n        //\n        $.table.sheets.add(sheet)\n	},\n     getAllAccountList(){\n        var sql=`\n        select a.id,a.name from t_account a \n        where a.company_id=? and a.status=1 order by a.id asc;\n        `\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add($.account.companyId);\n        var accountList=$.queryList(sql,values);\n        return accountList;\n    },\n    getAccountListByDepartmentName(departmentName){\n        var sql=`\n        select i2.id,i2.name from t_department a \ninner join t_department i1 on i1.id=a.parent_id\ninner join t_account i2 on i2.id=a.account_id\nwhere a.type=2 and i1.name=? order by i2.id asc;\n        `\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(departmentName);\n        var accountList=$.queryList(sql,values);\n        //$.info(accountList)\n        return accountList;\n    },\n	getScmCommitLogList(accountList,month){\n		var sql=`select DATE_FORMAT(a.create_time, \'%Y-%m-%d\') as riqi,i1.id as account_id,sum(add_line_num) as add_line_num,sum(decrease_line_num) as decrease_line_num,sum(add_line_num-decrease_line_num) as total_num from t_scm_commit_log a\ninner join t_account i1 on i1.user_name=a.author\nwhere 1=1 and i1.id in(`+accountList+`)\nand DATE_FORMAT(a.create_time, \'%Y-%m\')=? \ngroup by riqi,i1.id\norder by i1.id asc\n        `;\n        var ArrayList = Java.type(\"java.util.ArrayList\")\n        var values = new ArrayList()\n        values.add(month);\n		var list=$.queryList(sql,values)\n        //$.info(list)\n        return list;\n		\n	}\n}\n\n\n','统计成员本月每天的代码提交行数','{\"query\":[{\"name\":\"部门名称\",\"type\":\"text\"}]}',3,3,'2020-02-25 09:49:17','2020-04-23 10:45:45'),(2,1,'成员待办列表','默认','[1,10]',1,1,0,'var dataTable={\n    query:[\n        {name:\"成员姓名\",type:\"text\"}\n    ],\n    execute(){\n		var userName=$.param(\'成员姓名\');\n		if(userName==null||userName==\'\'){\n			$.error(\'请输入成员姓名\');\n			return;\n		}\n		this.queryTaskList(userName);\n		this.queryTaskProjectStat(userName);\n		this.queryTaskStatusStat(userName);\n	},\n	queryTaskList(userName){\n		var sheet=$.createSheet();\n		sheet.name=\'待办列表\'\n		//\n		for(var i=0;i<7;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=150;\n		sheet.col[1].width=80;\n		sheet.col[2].width=250;\n		sheet.col[3].width=80;\n		sheet.col[4].width=80;\n		sheet.col[5].width=120;\n		sheet.col[6].width=120;\n		//\n		var row=$.arrayToRow([\'项目\',\'编号\',\'名称\',\'类型\',\'状态\',\'开始时间\',\'结束时间\'])\n		sheet.header.add(row)\n		var sql=`\n		select i3.name as project_name,a.serial_no,a.name,i4.name as object_type_name,i5.name as status_name,a.start_date,a.end_date from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\ninner join t_object_type i4 on i4.id=a.object_type\ninner join t_project_status_define i5 on i5.id=a.status\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i1.name=?\norder by i3.name,i5.name\n		`\n		var tasks=$.queryList(sql,[userName])\n		for (i = 0; i < tasks.size(); i++) { \n			var task=tasks.get(i);\n			var mapKey=[\'project_name\',\n						\'serial_no\',\n						\'name\',\n						\'object_type_name\',\n						\'status_name\',\n						\'start_date\',\n						\'end_date\'];\n			sheet.body.add($.mapToRow(task,\n				mapKey,\n				{	\n					\'start_date\':\'fmtDate\',\n					\'end_date\':\'fmtDate\'\n				})\n			)\n		}\n		//\n		$.table.sheets.add(sheet);\n	},\n	queryTaskProjectStat(userName){\n		var sheet=$.createSheet();\n		sheet.name=\'项目统计\'\n		for(var i=0;i<4;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=100;\n		sheet.col[2].width=100;\n		sheet.col[3].width=400;\n\n		var row=$.arrayToRow([\'项目名称\',\'待办数量\'])\n		sheet.header.add(row)\n		\n\n		var sql=`\n		select i1.id,i3.name as project_name,i1.name as account_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i1.name=?\ngroup by i1.id,i3.id\norder by num desc;\n		`\n		var stat=$.queryList(sql,[userName])\n		for (i = 0; i < stat.size(); i++) { \n			var item=stat[i];\n			sheet.body.add($.mapToRow(item,[\'project_name\',\'num\'],{}))\n		}\n		//\n		var chart=$.createChart();\n        chart.title=\"项目数量\";\n        chart.height=400;\n        chart.cellRange.x1=0;\n        chart.cellRange.x2=1;\n        chart.cellRange.y1=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"pie\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	},\n	queryTaskStatusStat(userName){\n		var sheet=$.createSheet();\n		sheet.name=\'状态统计\'\n		for(var i=0;i<4;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=100;\n		sheet.col[2].width=100;\n		sheet.col[3].width=400;\n\n		var row=$.arrayToRow([\'状态名\',\'数量\'])\n		sheet.header.add(row)\n		\n\n		var sql=`\n		select i1.id,i5.name as status_name,i1.name as account_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\ninner join t_project_status_define i5 on i5.id=a.status\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1 and i1.name=?\ngroup by i1.id,i5.name\norder by num desc;\n		`\n		var stat=$.queryList(sql,[userName])\n		for (i = 0; i < stat.size(); i++) { \n			var item=stat[i];\n			sheet.body.add($.mapToRow(item,[\'status_name\',\'num\'],{}))\n		}\n		//\n		var chart=$.createChart();\n        chart.title=\"状态数量\";\n        chart.height=400;\n        chart.cellRange.x1=0;\n        chart.cellRange.x2=1;\n        chart.cellRange.y1=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"bar\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	}\n}\n','查看成员未完成的事项','{\"query\":[{\"name\":\"成员姓名\",\"type\":\"text\"}]}',2,3,'2019-05-31 17:19:43','2019-12-03 10:36:08'),(3,1,'成员待办数量','默认','[1]',1,1,1,'var dataTable={\n    query:[\n    ],\n    execute(){\n		this.queryTaskStatusStat();\n	},\n	queryTaskStatusStat(){\n		var sheet=$.createSheet();\n		sheet.name=\'待办任务数量\'\n		for(var i=0;i<2;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=300;\n		sheet.col[1].width=300;\n		var row=$.arrayToRow([\'责任人\',\'待办任务数量\'])\n		sheet.header.add(row)\n		var sql=`\n			select i1.id,i1.name as account_name,count(1) as num from t_task a \ninner join t_task_owner i0 on a.id=i0.task_id\ninner join t_account i1 on i0.account_id=i1.id\ninner join t_project_module i2 on i2.object_type=a.object_type and i2.project_id=a.project_id\ninner join t_project i3 on i3.id=a.project_id\nwhere a.is_delete=false and a.is_finish=false and i2.is_status_based=true and i3.status=1\ngroup by i1.id\norder by num desc;\n		`\n		var tasks=$.queryList(sql,[])\n		for (i = 0; i < tasks.size(); i++) {\n			var task=tasks.get(i);\n			var mapKey=[\'account_name\',\n						\'num\'];\n			sheet.body.add($.mapToRow(task,mapKey,null))\n		}\n		$.table.sheets.add(sheet);\n	}\n}\n','待办数量统计','{\"query\":[]}',2,2,'2019-05-31 17:19:43','2019-06-14 20:42:23'),(4,1,'需求工时统计','工时','[1,10]',1,1,0,' var dataTable={\n    query:[\n		{name:\"项目\",type:\"project\"}\n    ],\n    execute(){\n		var sheet=$.createSheet();\n		sheet.name=\'工时统计\'\n		for(var i=0;i<9;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=200;\n		sheet.col[1].width=80;\n		sheet.col[2].width=100;\n		sheet.col[3].width=200;\n		sheet.col[4].width=100;\n		sheet.col[5].width=100;\n		sheet.col[6].width=150;\n		sheet.col[7].width=100;\n		sheet.col[8].width=200;\n\n		var header0=$.arrayToRow([this.getProjectName()+\'-工时统计表\']);\n		header0.cells[0].colspan=9;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		\n		this.setupHeaderRow(header0);\n		sheet.header.add(header0)\n		//\n		var header1=$.arrayToRow([\'需求名称\',\'需求状态\',\'工时合计\',\'任务/缺陷/测试计划明细\']);\n		header1.cells[0].rowspan=2;\n		header1.cells[1].rowspan=2;\n		header1.cells[2].rowspan=2;\n		header1.cells[3].colspan=6;\n		//\n		header1.cells[3].align=\'center\';\n		\n		this.setupHeaderRow(header1);\n		sheet.header.add(header1)\n		//\n		var header2=$.arrayToRow([\'名称\',\'状态\',\'责任人\',\'工时录入日期\',\'工时\',\'工时详情\']);\n		//\n		this.setupHeaderRow(header2);\n		sheet.header.add(header2)\n		//\n		var storyList=this.executeSQL();\n		\n\n		for(var i=0;i<storyList.length;i++){\n			var story=storyList[i];\n			var row=$.createRow(9);\n			row.cells[0].value=story[\'name\'];\n			row.cells[1].value=story[\'status_name\'];\n			var hours=this.getWorkTimeTotal(story)\n			if(hours==0){\n				continue;\n			}\n			row.cells[2].value=hours+\"小时\";;\n			\n			var rowspan=story.allList.length;;\n			if(story.allList.length>0){\n				row.cells[0].rowspan=rowspan;\n				row.cells[1].rowspan=rowspan;\n				row.cells[2].rowspan=rowspan;\n			}\n			if(rowspan>=1){\n				var first=story.allList[0];\n				row.cells[3].value=first[\'task_name\'];\n				row.cells[4].value=first[\'task_status_name\'];\n				row.cells[5].value=first[\'owner_name\'];\n				row.cells[6].value=$.fmtDate(first[\'create_time\']);\n				row.cells[7].value=first[\'hour\']+\"小时\";\n				row.cells[8].value=first[\'content\'];\n			}\n			sheet.body.add(row);\n			for(var k=1;k<story.allList.length;k++){\n				var row2=$.createRow(6);\n				var wt=story.allList[k];\n				row2.cells[0].value=wt[\'task_name\'];\n				row2.cells[1].value=wt[\'task_status_name\'];\n				row2.cells[2].value=wt[\'owner_name\'];\n				row2.cells[3].value=$.fmtDate(wt[\'create_time\']);\n				row2.cells[4].value=wt[\'hour\']+\"小时\";\n				row2.cells[5].value=wt[\'content\'];\n				sheet.body.add(row2);\n			}\n\n			\n		}\n		//\n		$.table.sheets.add(sheet)\n	},\n	getWorkTimeTotal(story){\n		var t=0;\n		for(var i=0;i<story.allList.length;i++){\n			t+=story.allList[i].hour;\n		}\n		return t;\n	},\n	setupHeaderRow(row){\n		for(var i=0;i<row.cells.length;i++){\n			row.cells[i].bgcolor=\"eeeeee\"\n		}\n		\n	},\n	getProjectName(){\n		if($.query.projectId){\n			var sql=\'select name from t_project where id=\'+$.query.projectId;\n			return $.queryForString(sql)\n		}\n		$.error(\'请选择项目\')\n	},\n	executeSQL(){\n		var storySQL=`\n			select a.id,concat(\'#\',a.serial_no,\' \',a.name) as name,a.serial_no,i0.name as status_name from t_task a \n			inner join t_project_status_define i0 on a.status=i0.id\n			where a.object_type=3 and a.is_delete=false\n		`;\n		if($.query.projectId){\n			storySQL=storySQL+\' and a.project_id=\'+$.query.projectId+\' \';\n		}\n		if($.query.iterationId){\n			storySQL=storySQL+\' and a.iteration_id=\'+$.query.iterationId+\' \';\n		}\n		var storyList=$.queryList(storySQL);\n		//\n		var workTimeSQL=`\n			select i6.name as object_type_name,i0.id as task_id,concat(\'#\',i0.serial_no,\' \',i0.name) as task_name,i7.name as task_status_name,i4.name as owner_name,a.create_time,a.hour,a.content from t_task_work_time_log a\ninner join t_task i0 on a.task_id=i0.id\ninner join t_account i4 on a.create_account_id=i4.id\ninner join t_object_type i6 on i0.object_type=i6.id\ninner join t_project_status_define i7 on i0.status=i7.id\nwhere 1=1  and i0.is_delete=false\n		`;\n		if($.query.projectId){\n			workTimeSQL=workTimeSQL+\' and i0.project_id=\'+$.query.projectId+\' \';\n		}\n		if($.query.iterationId){\n			workTimeSQL=workTimeSQL+\' and i0.iteration_id=\'+$.query.iterationId+\' \';\n		}\n		var workTimeList=$.queryList(workTimeSQL);\n		//\n		var workTimeMap={};\n		for(var i=0;i<workTimeList.size();i++){\n			var item=workTimeList.get(i);\n			var taskId=item[\'task_id\'];\n			if(workTimeMap[taskId]==null){\n				workTimeMap[taskId]={\n					taskId:taskId,\n					list:[]\n				}\n			}\n			workTimeMap[taskId].list.push(item);\n		}\n		//\n		var relSQL=`\n			select a.task_id,a.associated_task_id from t_task_associated a\ninner join t_task i0 on a.task_id=i0.id\nwhere i0.object_type=3 \n		`;\n		if($.query.projectId){\n			relSQL=relSQL+\' and i0.project_id=\'+$.query.projectId+\' \';\n		}\n		if($.query.iterationId){\n			relSQL=relSQL+\' and i0.iteration_id=\'+$.query.iterationId+\' \';\n		}\n		var relList=$.queryList(relSQL);\n		//\n		for(var i=0;i<storyList.size();i++){\n			var story=storyList[i];\n			story[\'workTimeList\']=[];\n			for(var k=0;k<relList.length;k++){\n				var rel=relList[k];\n				if(rel[\'task_id\']==story.id){\n					var target=workTimeMap[rel[\'associated_task_id\']];\n					if(target){\n						story[\'workTimeList\'].push(target);\n						delete workTimeMap[rel[\'associated_task_id\']];\n					}\n				}\n			}\n		}\n		//未关联需求的任务\n		var otherStory={\n			id:0,\n			status_name:\"\",\n			name:\"未关联\",\n			workTimeList:[]\n		}\n		storyList.add(otherStory)\n		for(var k in workTimeMap){\n			var target=workTimeMap[k];\n			otherStory[\'workTimeList\'].push(target);\n		}\n		//\n		for(var i=0;i<storyList.length;i++){\n			var story=storyList[i];\n			story[\'allList\']=[];\n			for(var k=0;k<story[\'workTimeList\'].length;k++){\n				var innerList=story[\'workTimeList\'][k];\n				for(j=0;j<innerList.list.length;j++){\n					story[\'allList\'].push(innerList.list[j])\n				}\n			}\n		}\n		return storyList;\n	}\n}\n','以需求维度统计成员工时','{\"query\":[{\"name\":\"项目\",\"type\":\"project\"}]}',2,3,'2019-05-31 17:19:43','2019-07-22 17:07:19'),(5,1,'成员任务日历','默认','[1,11]',1,1,0,'var dataTable={\n    query:[\n		{name:\"项目\",type:\"project\"},\n		{name:\"部门名称\",type:\"text\"},\n    ],\n    execute(){\n        var d=new Date();\n        var year=d.getFullYear();\n        var month=d.getMonth()+1;\n        if(month>=10){\n            month=year+\'-\'+month;\n        }else{\n            month=year+\'-0\'+month;\n        }\n        //$.info(month)\n        //\n        var departmentName=$.param(\'部门名称\');\n        if(!departmentName){\n            $.error(\'请输入部门名称\')\n            return;\n        }\n        //\n		var sheet=$.createSheet();\n        var maxCol=33;\n		sheet.name=\'成员任务日历\'+month\n		for(var i=0;i<maxCol;i++){\n			sheet.col.add($.createCol());\n		}\n		sheet.col[0].width=100;\n		sheet.col[1].width=100;\n        for(var i=0;i<31;i++){\n            sheet.col[i+2].width=100;\n        }\n		var header0=$.arrayToRow([\'成员任务日历\'+month]);\n		header0.cells[0].colspan=maxCol;\n		header0.cells[0].align=\'center\';\n		header0.cells[0].fsize=20;\n		sheet.header.add(header0);\n        //\n        var header=[\'姓名\',\'部门\'];\n        for(var i=1;i<=31;i++){\n            header.push(i+\"号\")\n        }\n        //\n        var row=$.arrayToRow(header);\n        for(var i=0;i<maxCol;i++){\n            row.cells[i].bgcolor=\"8EE5EE\"\n        }\n        //row.cells[2].colspan=31;\n        //row.cells[2].align=\'center\';\n		//row.cells[2].fsize=20;\n        sheet.body.add(row);\n        //\n        var accountList=this.getAccountList(departmentName);\n        var taskList=this.getTaskList(month);\n        var taskMap={};\n        for (i = 0; i < taskList.size(); i++) {\n            var task=taskList.get(i);\n            var ownerAccountIdList=task[\'owner_account_id_list\']\n            ownerAccountIdList=ownerAccountIdList.replace(\'[\',\'\')\n            ownerAccountIdList=ownerAccountIdList.replace(\']\',\'\')\n            ownerAccountIdList=ownerAccountIdList.split(\",\")\n            for(var j=0;j<ownerAccountIdList.length;j++){\n                var ownerAccountId=ownerAccountIdList[j];\n                if(!taskMap[ownerAccountId]){\n                    taskMap[ownerAccountId]=[];\n                    \n                } \n                taskMap[ownerAccountId].push(task);\n            }\n        }\n        for (i = 0; i < accountList.size(); i++) {\n            var account=accountList[i];\n            var taskList=taskMap[account[\'account_id\']];\n            var cols=[account[\'account_name\'],account[\'department_name\']];\n            for(var d=1;d<=31;d++){\n                var taskNames=\'\';\n                if(taskList){\n                    for (t = 0; t < taskList.length; t++) {\n                        var task=taskList[t];\n                        var isFinish=task[\'is_finish\']\n                        if(isFinish){\n                            if(d>=task[\'start_day\']&&d<=task[\'finish_day\']){\n                                taskNames=taskNames+task[\'task_name\']\n                                taskNames=taskNames+\'\\n\';\n                            }\n                        }else{\n                            if(d>=task[\'start_day\']&&d<=task[\'end_day\']){\n                                taskNames=taskNames+task[\'task_name\']\n                                taskNames=taskNames+\'\\n\';\n                            }\n                        }\n                        \n                    }\n                }\n                cols.push(taskNames)\n            }\n            row=$.arrayToRow(cols);\n            sheet.body.add(row);\n        }\n        //\n        $.table.sheets.add(sheet)\n	},\n    addTaskList(sheet,objectType,maxCol,startDate,endDate){\n        var taskList=