ject_status_define i3 on a.status=i3.id\nwhere a.project_id=? and a.is_delete=false and a.is_finish=false and a.object_type=2\ngroup by i2.name;`\n			var objectList=$.queryList(sql,[$.query.projectId])\n			var ret={};\n			for (var index = 0; index < prioritys.length; index++) {\n				var priority=prioritys[index];\n				ret[priority]=0\n				for(var i=0;i<objectList.size();i++){\n					var item=objectList.get(i);\n					if(item[\'name\']==priority){\n						ret[priority]=item[\'count\']\n						break\n					}\n				}\n			}\n			//$.info(\'getUnfinishBugNums:\'+$.toJson(ret))\n			return ret; \n		}\n		$.error(\'请选择项目\')\n	},\n	getTotalTestCases(){\n		if($.query.projectId){\n			var sql=`select count(1) from t_task a \nwhere a.project_id=? and a.is_delete=false and a.object_type=5;`\n			return $.queryCount(sql,[$.query.projectId])\n		}\n		$.error(\'请选择项目\')\n	},\n	getExecuteTestCases(){\n		if($.query.projectId){\n			var sql=`select count(1) from t_task a \nwhere a.project_id=? \nand a.is_delete=false \nand a.object_type=5\nand a.id in(select distinct(test_case_id) from t_test_plan_test_case where project_id=? and status>1)\n`\n			return $.queryCount(sql,[$.query.projectId,$.query.projectId])\n		}\n		$.error(\'请选择项目\')\n	},\n	getUnfinishBugs(){\n		if($.query.projectId){\n			var sql=`\n				select a.serial_no,a.name,i2.name as priority_name,i3.name as status_name,i4.name as create_account_name,a.owner_account_list from t_task a \ninner join t_object_type i1 on a.object_type=i1.id\ninner join t_project_priority_define i2 on a.priority=i2.id\ninner join t_project_status_define i3 on a.status=i3.id\ninner join t_account i4 on a.create_account_id=i4.id\nwhere a.project_id=? and a.is_delete=false and a.is_finish=false and a.object_type=2;\n`\n			return $.queryList(sql,[$.query.projectId])\n		}\n		$.error(\'请选择项目\')\n	}\n}\n','对软件基本功能进行确认验证','{\"query\":[{\"name\":\"项目\",\"type\":\"project\"}]}',3,3,'2019-07-08 16:31:50','2020-02-06 11:59:46'),(7,1,'成员项目统计','默认','[1,10]',1,1,0,'var dataTa