=0;\n        chart.cellRange.y2=stat.size()-1;\n        //\n        chart.xAxis.index=0;\n        chart.xAxis.type=\'category\';\n        //\n        chart.yAxis.type=\'value\';\n        //\n        var series1=$.createSeries();\n        series1.index=1;\n        series1.name=\"数量\";\n        series1.type=\"bar\";\n        chart.series.add(series1);\n        //\n        var row=$.arrayToRow([$.toJson(chart)])\n        row.cells[0].type=\'chart\';\n        row.cells[0].colspan=3;\n        sheet.body.add(row);\n		//\n		//\n		$.table.sheets.add(sheet);\n	}\n}\n','统计部门待办事项','{\"query\":[{\"name\":\"部门名称\",\"type\":\"text\"},{\"name\":\"项目\",\"type\":\"project\"},{\"name\":\"成员名称\",\"type\":\"text\"}]}',3,3,'2020-03-11 12:03:32','2020-03-11 14:57:34');


